svg.script:
// top.initBar(document); // Give html access to SVG

// Replace with your function to monitor your process.
var percent = 0;
var count = 0;
function filePercent() {
  // Create some random data
  if( (count >  40 && count < 60) ||
      (count >  80 && count < 90) ||
      (count > 100 && count < 120) ) {
    // Stall
  } else {
    percent += Math.random();
  }
  ++count;
  if( percent > 100.0 ) {
    percent = 100.0;
    count = 0;
  }

  // Pass percent to html
  // top.filePercent(percent);

  return percent;
}


// Percentage of file loaded.
var file_percent  = 0;
var file_percent_old = -1;

// Are we done?
var file_loaded = false;
var steam_done  = false;
var sign_done   = false;

// Various gear angles, positions.
var angle_gauge   = 0;    // Angle of gauge needle.
var angle_wheel   = 0;    // Angle of intermediate wheel.
var angle_fly     = 0;    // Angle of fly wheel.
var angle_fly_old = 0;    // Old angle, to know when to release steam.
var angle_crank   = 0;    // Angle of crank.
var x_crank       = 0;    // Position of center of crank.
var y_crank       = 0;    // Position of center of crank.
var x_piston      = 0;    // Position of piston.

// Steam temp variables
var steam_scale   = 1.0;
var steam_x       = 0.0;
var steam_y       = 0.0;
var steam_opacity = 1.0;

// Steam counters
var steam1_count = 0;
var steam2_count = 0;

// Sign
var sign_count = 0;
var sign_angle = 0;
var sign_state = 0;
var sign_state_target = 0;

// The objects (normally groups)
var background;

var needle;
var needleShadow;
var gauge;
var wheel;
var fly;
var crank;
var cranktrans
var piston;

var handle;

var steam1;
var steam1Scale;
var steam1Trans;
var steam2;
var steam2Scale;
var steam2Trans;

var signBoard;
var signStart;
var signLoading;
var signStalled;
var signFinished;

function Start(evt) {

  // Get references to objects
  background      = evt.target.ownerDocument.getElementById("layerBackground" );
  needle          = evt.target.ownerDocument.getElementById("gNeedle"      );
  needleShadow    = evt.target.ownerDocument.getElementById("gNeedleShadow");
  gauge           = evt.target.ownerDocument.getElementById("gGauge"       );
  wheel           = evt.target.ownerDocument.getElementById("gWheel"       );
  fly             = evt.target.ownerDocument.getElementById("gFlyWheel"    );
  crank           = evt.target.ownerDocument.getElementById("gCrank"       );
  crankTrans      = evt.target.ownerDocument.getElementById("gCrankTrans"  );
  piston          = evt.target.ownerDocument.getElementById("gPiston"      );
  handle          = evt.target.ownerDocument.getElementById("gHandleRotate");

  steam1           = evt.target.ownerDocument.getElementById("gSteam1"       );
  steam1Scale      = evt.target.ownerDocument.getElementById("gSteam1Scale"  );
  steam1Trans      = evt.target.ownerDocument.getElementById("gSteam1Translate" );

  steam2           = evt.target.ownerDocument.getElementById("gSteam2"       );
  steam2Scale      = evt.target.ownerDocument.getElementById("gSteam2Scale"  );
  steam2Trans      = evt.target.ownerDocument.getElementById("gSteam2Translate" );

  signBoard        = evt.target.ownerDocument.getElementById("gSignboard"    );
  signStart        = evt.target.ownerDocument.getElementById("gTextStart"    );
  signLoading      = evt.target.ownerDocument.getElementById("gTextLoading"  );
  signStalled      = evt.target.ownerDocument.getElementById("gTextStalled"  );
  signFinished     = evt.target.ownerDocument.getElementById("gTextFinished" );

  // Init
  percent = 0;
  sign_count = 0;
  sign_state = 0;
  sign_state_target = 0;

  file_loaded = false;
  steam_done  = false;
  sign_done   = false;
  handle.setAttribute(  "transform", "rotate(-90)");

  signBoard.setAttribute("aria-pressed", true);

  // Start animation
  Run();
}

function Run() {

  // Get percentage of file loaded
  file_percent = filePercent();

  // Accessability: this allows progress to be indicated by speach, etc.
  background.setAttribute("aria-valuenow",file_percent);

  if( file_percent == 100.0 ) {
    handle.setAttribute(  "transform", "rotate(0)");
    signBoard.setAttribute("aria-pressed", false);
    file_loaded = true;
  }

  // Calculate position of gears/gauge/needle.
  angle_gauge = file_percent/100.0 * 150 - 75;
  angle_wheel = -angle_gauge *  6.0 + 8;
  angle_wheel = angle_wheel - Math.floor(angle_wheel/360.0) * 360.0;
  angle_fly   = -angle_wheel * 5.0;
  angle_fly   = angle_fly - Math.floor(angle_fly/360.0) * 360.0;

  var angle_to_rad = Math.PI / 180.0
  y_crank = -23 * Math.sin( angle_fly * angle_to_rad );
  angle_crank = Math.asin( y_crank/97.0 ) / angle_to_rad;
  y_crank /= 2.0;

  x_crank = -23 * Math.cos( angle_fly * angle_to_rad ) + 23;
  x_piston = x_crank; // Ignoring small x correction

  // Move/rotate/scale objects
  needle.setAttribute(          "transform", "rotate(" +angle_gauge+   ")");
  needleShadow.setAttribute(    "transform", "rotate(" +angle_gauge+   ")");
  gauge.setAttribute(           "transform", "rotate(" +angle_gauge+   ")");
  wheel.setAttribute(           "transform", "rotate(" +angle_wheel+   ")");
  fly.setAttribute(             "transform", "rotate(" +angle_fly+     ")");
  crank.setAttribute(           "transform", "rotate(" +angle_crank+     ")");
  crankTrans.setAttribute(      "transform", "translate(" +x_crank+ "," +y_crank+     ")");
  piston.setAttribute(          "transform", "translate(" +x_piston+ ", 0.0 )");

  // Steam --------------------

  //  Reset steam1 when angle_fly passes 0 and steam2 when angle_fly passes 180 degrees
  if( angle_fly < angle_fly_old ) {
    steam1_count = 0;
  }
  if( angle_fly > 180 && angle_fly_old < 180 ) {
    steam2_count = 0;
  }
  angle_fly_old = angle_fly;

  // Calculate postion/size/opacity of steam.
  var steam_max = 10.0;
  steam_scale   =       steam1_count / steam_max;
  steam_x       =  65 + steam1_count * 12.0;
  steam_y       = 275 - steam1_count * 7.0;
  steam_opacity = 1.0 - steam1_count / steam_max;

  if( steam1_count < steam_max ) {
    steam1.setAttribute("style", "fill-opacity:" +steam_opacity);
  } else {
    steam1.setAttribute("style", "display:none");
  }
  steam1Trans.setAttribute("transform", "translate(" +steam_x+ "," +steam_y+ ")");
  steam1Scale.setAttribute("transform", "scale(" +steam_scale+ "," +steam_scale+ ")");

  steam_scale   =       steam2_count / 10.0;
  steam_x       = 65  + steam2_count * 10.0;
  steam_y       = 275 - steam2_count * 5.0;
  steam_opacity = 1.0 - steam2_count / 10.0;

  if( steam2_count < steam_max ) {
    steam2.setAttribute("style", "fill-opacity:" +steam_opacity);
  } else {
    steam2.setAttribute("style", "display:none");
  }
  steam2Trans.setAttribute("transform", "translate(" +steam_x+ "," +steam_y+ ")");
  steam2Scale.setAttribute("transform", "scale(" +steam_scale+ "," +steam_scale+ ")");

  // Make sure that steam has chance to finish when file loading finished.
  if( steam1_count >= steam_max && steam2_count >= steam_max ) {
    steam_done = true;
  } else {
    steam_done = false;
  }

  steam1_count++;
  steam2_count++;

  // Sign ---------------------------------

  // Target state
  if( file_loaded) {
    sign_state_target = 3; // Loaded
  } else {
    if( file_percent == file_percent_old ) {
      sign_state_target = 2; // Stalled
    } else {
      sign_state_target = 1; // Loading
    }
    file_percent_old = file_percent;
  }

  // Rotate sign and change text when "horizontal"
  var sign_max = 3;
  if( sign_state != sign_state_target ) {
    ++sign_count;
    if( sign_count >= sign_max ) {
      // Sign horizontal: switch state
      sign_state = sign_state_target;
      sign_count = sign_max;
    }
  } else {
    --sign_count;
    if( sign_count <= 0 ) {
      // Sign vertical
      sign_count = 0;
    }
  }

  var sign_scale = Math.cos( sign_count / sign_max * Math.PI/2.0 );
  signBoard.setAttribute(   "transform", "scale(1.0," +sign_scale+ ")");

  // Display selected text
  switch( sign_state ) {
    case 0:
      signStart.setAttribute(   "style", "");
      signLoading.setAttribute( "style", "display:none");
      signStalled.setAttribute( "style", "display:none");
      signFinished.setAttribute("style", "display:none");
      break;
    case 1:
      signStart.setAttribute(   "style", "display:none");
      signLoading.setAttribute( "style", "");
      signStalled.setAttribute( "style", "display:none");
      signFinished.setAttribute("style", "display:none");
      break;
    case 2:
      signStart.setAttribute(   "style", "display:none");
      signLoading.setAttribute( "style", "display:none");
      signStalled.setAttribute( "style", "");
      signFinished.setAttribute("style", "display:none");
      break;
    case 3:
      signStart.setAttribute(   "style", "display:none");
      signLoading.setAttribute( "style", "display:none");
      signStalled.setAttribute( "style", "display:none");
      signFinished.setAttribute("style", "");
      break;
    default:
      // Not reached
  }


  // Repeat every nth of a second.
  if( !file_loaded || !steam_done ||!sign_done ) {
    setTimeout("Run()", 200)
  } else {
    signLoading.setAttribute("style", "display:none");
    signStalled.setAttribute("style", "display:none");
    signFinished.setAttribute("style", "");
  }
}
